import React, { useState } from "react";
import "./Home.css";
import Header from "../components/Header";

// Import images properly
import stressImg from "../assets/stress.png";
import wellnessImg from "../assets/wellness.png";
import activityImg from "../assets/activity.png";
import chatImg from "../assets/chat.png";

import med1 from "../assets/meditation1.jpg";
import med2 from "../assets/meditation2.jpg";
import med3 from "../assets/meditation3.jpg";
import med4 from "../assets/meditation4.jpg";

const exerciseVideos = {
  sleep: "https://www.youtube.com/embed/aEqlQvczMJQ",
  breathing: "https://www.youtube.com/embed/sJ04nsiz_M0",
  meditation: "https://www.youtube.com/embed/inpok4MKVLM",
  yoga: "https://www.youtube.com/embed/hJbRpHZr_d0",
};

function Home() {
  const [videoUrl, setVideoUrl] = useState("");
  const [showVideo, setShowVideo] = useState(false);

  const openVideo = (url) => {
    setVideoUrl(url);
    setShowVideo(true);
  };

  const closeVideo = () => {
    setVideoUrl("");
    setShowVideo(false);
  };

  return (
    <>
      <Header />

      {/* HERO SECTION */}
      <div className="hero-section">
        <div className="hero-content">
          <h1>Your Mental Wellbeing Matters</h1>
          <p>
            AI-powered stress detection, activity analysis, wellness tips, and mental health support.
          </p>
        </div>
      </div>

      {/* AI FEATURES */}
      <section className="features-section">
        <h2>AI-Based Features</h2>
        <p className="sub-text">Select a feature to begin.</p>

        <div className="card-row">

          <div className="feature-card">
            <img src={stressImg} alt="Stress Detection" />
            <h3>AI Stress Detection</h3>
            <p>Upload ECG/PPG/HRV data to detect stress using ML.</p>
          </div>

          <div className="feature-card">
            <img src={wellnessImg} alt="Wellness Tips" />
            <h3>Smart Wellness Tips</h3>
            <p>Automatic lifestyle & wellness suggestions.</p>
          </div>

          <div className="feature-card">
            <img src={activityImg} alt="Activity Analyzer" />
            <h3>Activity Analyzer</h3>
            <p>Detect behaviour triggers from uploaded data.</p>
          </div>

          <div className="feature-card">
            <img src={chatImg} alt="AI Chat Assistant" />
            <h3>AI Chat Assistant</h3>
            <p>Talk to the AI and get support instantly.</p>
          </div>
        </div>
      </section>

      {/* EXERCISES */}
      <section className="features-section">
        <h2>Mental Health Exercises</h2>
        <p className="sub-text">Improve your wellbeing with guided activities.</p>

        <div className="card-row">

          <div className="feature-card" onClick={() => openVideo(exerciseVideos.sleep)}>
            <img src={med1} alt="Better Sleep" />
            <h3>Better Sleep</h3>
            <p>Guided sleep meditation for deeper rest.</p>
          </div>

          <div className="feature-card" onClick={() => openVideo(exerciseVideos.breathing)}>
            <img src={med2} alt="Breathing" />
            <h3>Deep Breathing</h3>
            <p>4-7-8 breathing to reduce anxiety.</p>
          </div>

          <div className="feature-card" onClick={() => openVideo(exerciseVideos.meditation)}>
            <img src={med3} alt="Meditation" />
            <h3>Calm Meditation</h3>
            <p>10-minute mindfulness meditation.</p>
          </div>

          <div className="feature-card" onClick={() => openVideo(exerciseVideos.yoga)}>
            <img src={med4} alt="Yoga" />
            <h3>Anxiety Relief Yoga</h3>
            <p>Gentle yoga flow to release tension.</p>
          </div>
        </div>
      </section>

      {/* ABOUT */}
      <section className="about-section">
        <h2>About The Project</h2>
        <p>
          Mental wellbeing is essential for a balanced and healthy life. Our platform combines AI 
          with proven mental health practices like meditation and deep breathing to help users 
          manage stress and build long-term emotional strength.
        </p>

        <p>
          With AI-powered insights and guided exercises, we aim to support individuals in achieving 
          better emotional resilience and mental clarity.
        </p>
      </section>

      {/* FOOTER */}
      <footer className="footer">© 2025 Mental Health Monitoring</footer>

      {/* VIDEO MODAL */}
      {showVideo && (
        <div className="video-modal">
          <div className="video-container">
            <span className="close-btn" onClick={closeVideo}>×</span>
            <iframe
              src={videoUrl}
              title="Exercise Video"
              frameBorder="0"
              allow="autoplay; encrypted-media"
              allowFullScreen
            ></iframe>
          </div>
        </div>
      )}
    </>
  );
}

export default Home;
